import React from "react";
import PaintingCard from "../components/PaintingCard";

export default function Paintings() {
  const paintings = [
    { title: "Sunset Dream", imageUrl: "/images/painting-1.jpg" },
    { title: "Quiet River", imageUrl: "/images/painting-2.jpg" },
    // add more
  ];

  return (
    <section className="gallery">
      <h2>Paintings</h2>
      <div className="grid">
        {paintings.map((p, i) => (
          <PaintingCard key={i} painting={p} />
        ))}
      </div>
    </section>
  );
}
